'use strict';

// VARIABLES //

var opts = {
	'globals': [
		'ArrayBuffer',
		'Buffer',
		'DataView',
		'Float32Array',
		'Float64Array',
		'Int8Array',
		'Int16Array',
		'Int32Array',
		'SharedArrayBuffer',
		'Uint8Array',
		'Uint8ClampedArray',
		'Uint16Array',
		'Uint32Array'
	]
};


// MAIN //

var valid = [];
var test;

test = {
	'code': [
		'// VARIABLES //',
		'',
		'var arr = new Array( 10 );'
	].join( '\n' ),
	'options': [ opts ]
};
valid.push( test );


// EXPORTS //

module.exports = valid;
